import React, { useEffect, useState } from "react";
import { Col, Container, Row, Table } from "react-bootstrap";

export default function Home() {

    const [ list, setList ] = useState([]);

    const Api_Url = "https://api.punkapi.com/v2/beers";

    const pageNumber = 2;
    const perPage = 10;


    useEffect(() =>{
        fetch('https://api.punkapi.com/v2/beers/')
        .then(res => res.json())
        .then(data =>  console.log("data", data));
    }, []);

    const paginateParams = () => {
        fetch('https://api.punkapi.com/v2/beers/?page='+pageNumber+'&per_page='+perPage)
        .then(res => res.json())
        .then(data =>  {
            console.log("data", data);
            setList(data);
        });
    }

    return(
        <div>
            <Container>
                <Row>
                    <Col>
                        <h2>Home</h2>
                        <Table responsive>
                            <thead>
                                <tr>Id</tr>
                                <tr>name</tr>
                                <tr>tagline</tr>
                                <tr>first_brewed</tr>
                                <tr>description</tr>
                                <tr>image_url</tr>
                                <tr>abv</tr>
                                <tr>ibu</tr>
                                <tr>target_fg</tr>
                                <tr>target_og</tr>
                                <tr>ebc</tr>
                                <tr>srm</tr>
                                <tr>ph</tr>
                                <tr>attenuation_level</tr>
                                <tr>volume</tr>
                                <tr>boil_volume</tr>
                                <tr>mash_temp</tr>
                                <tr>mash_temp duration</tr>
                                <tr>fermentation</tr>
                                <tr>twist</tr>
                                <tr>ingredients malt</tr>
                                <tr>hops</tr>
                                <tr>yeast</tr>
                                <tr>food_pairing</tr>
                                <tr>brewers_tips</tr>
                                <tr>contributed_by</tr>
                            </thead>
                            <tbody>
                                {
                                    list.length > 0 ?

                                    list.map((items, index) => {
                                        <tr key={index}>
                                            <td>{items.id}</td>
                                        </tr>
                                    })

                                    :

                                    <></>
                                }
                                <tr>
                                    <td></td>
                                </tr>
                            </tbody>
                        </Table>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}
